    <td><![endif]>
    <div>
    <p class=MsoNormal style='line-height:115%'><span style='font-size:14.0pt;
    mso-bidi-font-size:11.0pt;line-height:115%'>La asignatura de Matemáticas
    con el profesor Zayas nos apoyara con un punto en su asignatura a cambio de
    darle unas graficas respecto a las personas que participaron en el evento.<o:p></o:p></span></p>
    <p class=MsoNormal style='line-height:115%'><span style='font-size:14.0pt;
    mso-bidi-font-size:11.0pt;line-height:115%'>La profesora de inglés (Inés)
    nos apoya con punto cinco en su materia por asistir al evento.<o:p></o:p></span></p>
    <p class=MsoNormal style='line-height:115%'><span style='font-size:14.0pt;
    mso-bidi-font-size:11.0pt;line-height:115%'>Las profesoras de psicología (Angelica)
    y filosofía (Magaly) nos apoyan con el 20% de su materia por una infografía
    que tenga que ver con el vacío existencial y el consumismo.</span><span
    style='font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%'><o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:12.0pt;mso-bidi-font-size:11.0pt;
    line-height:200%'><o:p>&nbsp;</o:p></span></p>
    </div>
    <![if !mso]></td>
   </tr>
  </table>
  <![endif]></v:textbox>
